var b="url",c="njs_4_1_your_finances.html",d="generationDate",e=new Date(1429099444668.21),f="isCanvasEnabled",g=false,h="variables",i="OnLoadVariable",j="EmailVar",k="FullnameVar",l="ContactnumVar",m="UrnVar1",n="UrnVar2",o="UrnVar3",p="UrnVar4",q="DayVar",r="MonthVar",s="YearVar",t="AcoomodationVAR",u="InsuranceVAR",v="UtilityVAR",w="CounilTaxVAR",x="TVVAR",y="TravelVAR",z="LoanVAR",A="ChildVAR",B="TelephoneVAR",C="CountyCourtVAR",D="NumChargesVAR",E="page",F="packageId",G="98247e6f84724047af2e2f5765b086c6",H="type",I="Axure:Page",J="name",K="NJS 4.1 Your finances",L="notes",M="Note",N="<p><span style=\"font-family:'.HelveticaNeueDeskInterface-Bold', '.Helvetica Neue DeskInterface Bold', '.Helvetica Neue DeskInterface';font-weight:700;\">NJS 4.1 Your finances</span><span></span></p><p><span>None JavaScript version of the Your finances screen</span></p><p><span>&nbsp;</span></p><p><span>When the user selects an </span><span style=\"font-family:'Arial-BoldMT', 'Arial Bold', 'Arial';font-weight:700;\">Are you?</span><span> option the screen does not update like the JavaScript version.</span></p><p><span>Instead the user selects the continue CTA which directs them to a new screen </span></p><p><span>&nbsp;</span></p><p><span>If the user selected Employed they will be directed to:</span></p><p><span style=\"font-family:'.HelveticaNeueDeskInterface-Bold', '.Helvetica Neue DeskInterface Bold', '.Helvetica Neue DeskInterface';font-weight:700;\">NJS 4.1.1 Your finances continued - Employed</span><span style=\"font-family:'.HelveticaNeueDeskInterface-Regular', '.Helvetica Neue DeskInterface';\"> - </span><span>where the details relating to this option are shown.</span></p><p><span>&nbsp;</span></p><p><span>If the user selected Employed they will be directed to:</span></p><p><span style=\"font-family:'.HelveticaNeueDeskInterface-Bold', '.Helvetica Neue DeskInterface Bold', '.Helvetica Neue DeskInterface';font-weight:700;\">NJS 4.1.2 Your finances continued - Self-employed</span><span style=\"font-family:'.HelveticaNeueDeskInterface-Regular', '.Helvetica Neue DeskInterface';\"> - </span><span>where the details relating to this option are shown.</span></p><p><span>&nbsp;</span></p><p><span>If the user selected Employed they will be directed to:</span></p><p><span style=\"font-family:'.HelveticaNeueDeskInterface-Bold', '.Helvetica Neue DeskInterface Bold', '.Helvetica Neue DeskInterface';font-weight:700;\">NJS 4.1.3 Your finances continued - Receiving benefits</span><span style=\"font-family:'.HelveticaNeueDeskInterface-Regular', '.Helvetica Neue DeskInterface';\"> - </span><span>where the details relating to this option are shown.</span></p><p><span>&nbsp;</span></p><p><span>If the user selected Employed they will be directed to:</span></p><p><span style=\"font-family:'.HelveticaNeueDeskInterface-Bold', '.Helvetica Neue DeskInterface Bold', '.Helvetica Neue DeskInterface';font-weight:700;\">NJS 4.1.4 Your finances continued - Other</span><span style=\"font-family:'.HelveticaNeueDeskInterface-Regular', '.Helvetica Neue DeskInterface';\"> - </span><span>where the details relating to this option are shown.</span></p><p><span>&nbsp;</span></p><p><span style=\"font-family:'Arial-BoldMT', 'Arial Bold', 'Arial';font-weight:700;\">Note</span><span></span></p><p><span>A link will be available to the user from </span><span style=\"font-family:'.HelveticaNeueDeskInterface-Regular', '.Helvetica Neue DeskInterface';\">either of these screens that will enable the user to come back to this screen if they want to change their selection.</span></p><p><span style=\"font-family:'.HelveticaNeueDeskInterface-Regular', '.Helvetica Neue DeskInterface';\">If the user does go come back and change their selection, when they select the continue CTA again the user should be redirected accordingly based on their new selection.</span></p>",O="style",P="baseStyle",Q="627587b6038d43cca051c114ac41ad32",R="pageAlignment",S="near",T="fill",U="fillType",V="solid",W="color"